import React from 'react'

export default class UserKeyData extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            userId: props.id,
            calorieCount: props.calories,
            proteinCount: props.protein,
            carbohydrateCount: props.carb,
            lipidCount: props.lipid,
        }
    }
}
